const results = $input.all()[0].json;
const config = $('Config').item.json;

if (!results.items || !Array.isArray(results.items)) {
  return [];
}

const leads = results.items.map(user => {
  // Extract relevant info from GitHub profile
  const lead = {
    name: user.name || user.login,
    title: 'Software Developer', // Will be enriched from bio
    company: user.company || 'Independent',
    location: user.location || 'Unknown',
    profileUrl: user.html_url,
    githubUrl: user.html_url,
    avatarUrl: user.avatar_url,
    bio: user.bio || '',
    blog: user.blog || '',
    email: user.email, // Often null in search results
    followers: user.followers || 0,
    publicRepos: user.public_repos || 0,
    source: 'GitHub API',
    discoveredAt: new Date().toISOString()
  };

  // Try to extract role from bio
  if (lead.bio) {
    const bioLower = lead.bio.toLowerCase();
    if (bioLower.includes('cto')) lead.title = 'CTO';
    else if (bioLower.includes('vp eng')) lead.title = 'VP Engineering';
    else if (bioLower.includes('founder')) lead.title = 'Founder';
    else if (bioLower.includes('ceo')) lead.title = 'CEO';
    else if (bioLower.includes('head of eng')) lead.title = 'Head of Engineering';
    else if (bioLower.includes('director')) lead.title = 'Engineering Director';
  }

  // Estimate company size based on indicators
  lead.companySize = lead.company === 'Independent' ? 1 : 100; // Default estimate

  return { json: lead };
});

return leads;

const article = $input.item.json;
const config = $('Config').item.json;

// Extract potential leads from funding news
const leads = [];
const content = (article.content || article.description || '').toLowerCase();
const title = (article.title || '').toLowerCase();

// Check if it's funding news
const fundingKeywords = ['raised', 'funding', 'series', 'investment', 'million', 'round'];
const isFunding = fundingKeywords.some(kw => title.includes(kw) || content.includes(kw));

if (!isFunding) {
  return { json: { skipped: true } };
}

// Extract company name from title
let companyName = '';
const titleMatch = article.title.match(/^([^,]+?)\s+(raises|secures|closes|announces)/i);
if (titleMatch) {
  companyName = titleMatch[1].trim();
}

// Try to extract founder names and funding amount
const founderPatterns = [
  /founded by ([A-Z][a-z]+ [A-Z][a-z]+)/g,
  /CEO ([A-Z][a-z]+ [A-Z][a-z]+)/g,
  /founder ([A-Z][a-z]+ [A-Z][a-z]+)/g,
  /co-founder ([A-Z][a-z]+ [A-Z][a-z]+)/g
];

const amountMatch = content.match(/\$([0-9.]+)\s*(million|M)/i);
const fundingAmount = amountMatch ? `$${amountMatch[1]}M` : 'Undisclosed';

// Extract founder names
const foundersSet = new Set();
founderPatterns.forEach(pattern => {
  const matches = content.matchAll(pattern);
  for (const match of matches) {
    if (match[1]) foundersSet.add(match[1]);
  }
});

// Create lead entries
if (foundersSet.size > 0 || companyName) {
  const founderNames = Array.from(foundersSet);

  if (founderNames.length > 0) {
    // Create leads for each founder found
    founderNames.forEach(name => {
      leads.push({
        json: {
          name: name,
          title: 'Founder/CEO',
          company: companyName || 'Startup',
          companySize: 50, // Estimate for funded startups
          location: 'United States', // Default
          profileUrl: article.link,
          newsUrl: article.link,
          fundingAmount: fundingAmount,
          source: 'TechCrunch',
          bio: `Recently raised ${fundingAmount} in funding`,
          email: null,
          discoveredAt: new Date().toISOString(),
          recentActivity: article.title
        }
      });
    });
  } else if (companyName) {
    // Create a generic lead for the company
    leads.push({
      json: {
        name: `${companyName} Leadership`,
        title: 'Founder/CEO',
        company: companyName,
        companySize: 50,
        location: 'United States',
        profileUrl: article.link,
        newsUrl: article.link,
        fundingAmount: fundingAmount,
        source: 'TechCrunch',
        bio: `Company recently raised ${fundingAmount}`,
        email: null,
        discoveredAt: new Date().toISOString(),
        recentActivity: article.title
      }
    });
  }
}

return leads.length > 0 ? leads : [{ json: { skipped: true } }];

const lead = $input.item.json;
const config = $('Config').item.json;

// Skip if this was a skipped item
if (lead.skipped) {
  return { json: { skip: true } };
}

// Ensure required fields
lead.id = lead.id || `lead_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;
lead.name = lead.name || 'Unknown';
lead.title = lead.title || 'Unknown Role';
lead.company = lead.company || 'Unknown Company';

// Check role match
const targetRoles = config.targetRoles.split(',').map(r => r.trim().toLowerCase());
const leadRole = lead.title.toLowerCase();
const roleMatch = targetRoles.some(role => leadRole.includes(role)) || 
                  (lead.bio && targetRoles.some(role => lead.bio.toLowerCase().includes(role)));

// Calculate qualification score
let score = 0;

// Role scoring
if (roleMatch) score += 40;
if (lead.title.includes('Founder') || lead.title.includes('CEO')) score += 10;

// Activity scoring
if (lead.followers > 500) score += 20;
else if (lead.followers > 100) score += 10;

// Funding scoring
if (lead.fundingAmount && lead.fundingAmount !== 'Undisclosed') score += 20;

// Recent activity
if (lead.recentActivity) score += 10;

// Company validation
if (lead.company && lead.company !== 'Unknown Company' && lead.company !== 'Independent') score += 10;

lead.qualificationScore = score;
lead.qualified = score >= 50; // Lower threshold for real data

// Categorize
if (score >= 80) lead.tier = 'A';
else if (score >= 60) lead.tier = 'B';
else if (score >= 40) lead.tier = 'C';
else lead.tier = 'D';

// Add metadata
lead.processedAt = new Date().toISOString();
lead.matchCriteria = {
  roleMatch,
  hasActivity: !!lead.recentActivity,
  hasFunding: !!lead.fundingAmount,
  socialProof: lead.followers > 100
};

return { json: lead };

const config = $('Config').item.json;
const items = $input.all();
const leads = items.filter(item => !item.json.skip);

// Get cache
let cache = $getWorkflowStaticData('global');
if (!cache.seenLeads) cache.seenLeads = {};

// Deduplicate
const unique = [];
const stats = {
  totalProcessed: leads.length,
  duplicates: 0,
  newLeads: 0
};

for (const lead of leads) {
  const key = `${lead.json.name}_${lead.json.company}`.toLowerCase().replace(/[^a-z0-9]/g, '');

  if (!cache.seenLeads[key]) {
    unique.push(lead);
    stats.newLeads++;

    if (!config.dryRun) {
      cache.seenLeads[key] = {
        firstSeen: new Date().toISOString(),
        source: lead.json.source
      };
    }
  } else {
    stats.duplicates++;
  }
}

// Clean old cache entries
if (Object.keys(cache.seenLeads).length > 5000) {
  const entries = Object.entries(cache.seenLeads);
  entries.sort((a, b) => new Date(a[1].firstSeen) - new Date(b[1].firstSeen));
  cache.seenLeads = Object.fromEntries(entries.slice(-2500));
}

// Add stats to leads
return unique.map(lead => ({
  json: { ...lead.json, stats }
}));

// Enrich lead with AI insights
const lead = $input.item.json;

// Simulate AI enrichment (in production, would call Claude API)
const insights = {
  buyingIntent: 'medium',
  painPoints: [],
  recommendedApproach: '',
  estimatedDealSize: '$10K-50K',
  personalityType: 'Technical Decision Maker'
};

// Analyze based on available data
if (lead.fundingAmount) {
  insights.buyingIntent = 'high';
  insights.painPoints.push('Scaling infrastructure');
  insights.painPoints.push('Hiring technical talent');
  insights.recommendedApproach = 'Focus on growth enablement';

  // Estimate deal size based on funding
  const amount = lead.fundingAmount.match(/\$([0-9.]+)M/i);
  if (amount && parseFloat(amount[1]) > 10) {
    insights.estimatedDealSize = '$50K-200K';
  }
}

if (lead.bio) {
  const bioLower = lead.bio.toLowerCase();
  if (bioLower.includes('scale') || bioLower.includes('growth')) {
    insights.painPoints.push('Scaling challenges');
  }
  if (bioLower.includes('security') || bioLower.includes('compliance')) {
    insights.painPoints.push('Security & compliance');
  }
  if (bioLower.includes('ai') || bioLower.includes('ml')) {
    insights.painPoints.push('AI/ML implementation');
  }
}

// Recommend approach based on profile
if (lead.source === 'GitHub API' && lead.followers > 500) {
  insights.personalityType = 'Technical Influencer';
  insights.recommendedApproach = 'Developer-focused pitch, technical deep dive';
} else if (lead.source === 'TechCrunch') {
  insights.personalityType = 'Business-focused Leader';
  insights.recommendedApproach = 'ROI and growth metrics focus';
}

// Email prediction (if not available)
if (!lead.email && lead.name && lead.company) {
  const firstName = lead.name.split(' ')[0].toLowerCase();
  const companyDomain = lead.company.toLowerCase().replace(/[^a-z0-9]/g, '');
  lead.emailPrediction = `${firstName}@${companyDomain}.com`;
  lead.emailConfidence = 0.6;
}

lead.aiInsights = insights;
lead.enrichedAt = new Date().toISOString();

return { json: lead };

const config = $('Config').item.json;
const leads = $input.all();
const stats = leads[0]?.json.stats || {};

// Group by tier
const tiers = { A: [], B: [], C: [] };
leads.forEach(l => {
  if (tiers[l.json.tier]) tiers[l.json.tier].push(l.json);
});

// Format report
const report = {
  summary: {
    totalQualified: leads.length,
    tierA: tiers.A.length,
    tierB: tiers.B.length,
    tierC: tiers.C.length,
    githubLeads: leads.filter(l => l.json.source === 'GitHub API').length,
    fundingLeads: leads.filter(l => l.json.source === 'TechCrunch').length,
    ...stats
  },
  leads: leads.map(l => ({
    name: l.json.name,
    title: l.json.title,
    company: l.json.company,
    location: l.json.location || 'Unknown',
    tier: l.json.tier,
    score: l.json.qualificationScore,
    source: l.json.source,
    profileUrl: l.json.profileUrl || l.json.githubUrl || l.json.newsUrl,
    fundingAmount: l.json.fundingAmount,
    followers: l.json.followers,
    insights: l.json.aiInsights,
    email: l.json.email || l.json.emailPrediction,
    emailConfidence: l.json.emailConfidence
  })),
  generatedAt: new Date().toISOString(),
  config
};

// Generate CSV
const csv = [
  'Name,Title,Company,Location,Tier,Score,Source,Profile URL,Email',
  ...report.leads.map(l => 
    `"${l.name}","${l.title}","${l.company}","${l.location}",${l.tier},${l.score},"${l.source}","${l.profileUrl}","${l.email || ''}"`
  )
].join('\n');

report.csv = csv;

return [{ json: report }];

const data = $input.item.json;
const config = data.config;

if (config.dryRun) {
  return {
    json: {
      ...data,
      action: 'preview',
      message: 'Dry run - real leads found but not stored',
      previewLeads: data.leads.slice(0, 5),
      deliveryMethod: 'Would be sent to CRM/Database'
    }
  };
} else {
  // Production mode
  return {
    json: {
      ...data,
      action: 'delivered',
      message: 'Leads delivered successfully',
      deliveredAt: new Date().toISOString(),
      deliveryMethod: 'API/Webhook',
      recordsCreated: data.leads.length
    }
  };
}

const data = $input.item.json;
const config = data.config;

if (!config.dryRun) {
  const stats = $getWorkflowStaticData('global');

  if (!stats.lifetime) {
    stats.lifetime = {
      totalLeads: 0,
      tierALeads: 0,
      runs: 0,
      sources: { github: 0, news: 0 }
    };
  }

  stats.lifetime.totalLeads += data.summary.totalQualified;
  stats.lifetime.tierALeads += data.summary.tierA;
  stats.lifetime.runs += 1;
  stats.lifetime.sources.github += data.summary.githubLeads;
  stats.lifetime.sources.news += data.summary.fundingLeads;
  stats.lifetime.lastRun = new Date().toISOString();

  data.lifetimeStats = stats.lifetime;
}

return [{ json: data }];

